import React, { useState } from "react";
// import { IoClose, IoMenu } from "react-icons/io5";
import "./Navbar.css";

const Navbar = () => {
    return(
        <nav className="bar">

            <div to="/" className="logo">Lastenkarle</div>

            <div className="drop_down">
                Booking
            </div>
            <div className="drop_down">
                Store list
            </div>
        </nav>
    )
}

export default Navbar;
